import { useRef, useLayoutEffect } from "react";

const Input = () => {
  const inputElementRef = useRef();

  useLayoutEffect(() => {
    inputElementRef.current.focus();
  });

  return (
    <>
    <input type="text" ref={inputElementRef} placeholder='E-mail'  />
    </>
  )
}

export default Input;
